import React, {useState} from "react";
const Multiuser_Login_Page =() => {
    
        const [employeeuser_id, setEmployeeuserid] = useState("");
        const [userpassword, setuserPassword] = useState("");
        const [alluserEntry, setuserAllEntry] = useState([]);
        const submituserForm = (e) => {
            e.preventDefault();
            const newuserEntry = {employeeuser_id:employeeuser_id, userpassword:userpassword}
            setuserAllEntry([...alluserEntry, newuserEntry]);    
        }

    return (
        <div className = "usersignin"> <div className=" uuu"> 
<form action="" onSubmit={submituserForm}> 
<h1> <strong> Sign In  </strong></h1>
<label> <h3> User Employee Id </h3> <br/>
                    <input type="numbers" id="employeeuser_id" name="employeeuser_id" autoComplete="off" 
                    value={employeeuser_id} onChange={(e) => setEmployeeuserid(e.target.value)} required placeholder ="123456789" required/>
                    </label>
                    <div>
                    <label> <h3> User Password </h3> <br/>
                    <input type="password" id="userpassword" name="userpassword" autoComplete="off" 
                    value={userpassword} onChange={(e) => setuserPassword(e.target.value)} required placeholder ="*****" required /> 
                    </label>
                    </div>
                    <br/>
                    <button type = "Login"> User Login </button>
                    
                    </form> </div>
                    <div> <form>  fffffffffffffffff </form> </div>                                   </div>
    )
     }
    export default Multiuser_Login_Page;
